import React from 'react';


const Home = () => {
    return (
        <div className="container-xxl bg-info hero-header">
            <div className="container">
                <div className="row g-5 align-items-center">
                    <div className="col-lg-6 text-center text-lg-start">
                        <h1 className="text-white mb-4 animated zoomIn">Unlock your potential with personalized consultation services</h1>
                        <p className="text-white pb-3 animated zoomIn">
                            A consultation service that emphasizes its ability to provide tailored solutions to each client's unique needs. The website could highlight the personalized approach and the extensive range of services offered, from business strategy and marketing to HR and finance.
                        </p>
                        <a href="/" className="btn btn-outline-light rounded-pill border-2 py-3 px-5 animated slideInRight">Learn More</a>
                    </div>
                    <div className="col-lg-6 text-center text-lg-start">
                        <img className="img-fluid animated zoomIn" src="img/hero.png" alt="Hero Image" />
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Home;
